import React from "react";

function Student(props) {
  const onSubmit = (e) => {
    e.preventDefault();
  };
  return (
    <div>
      <form action="" onSubmit={onSubmit}>
        <input type="text" />
        <input type="password" />
        <button>회원가입</button>
      </form>
    </div>
  );
}

export default Student;
